import React, { Component } from 'react'

class Profile extends Component {
  constructor(props) {
    super(props)

    this.state = {
      data: null,
    }
  }

  componentDidMount() {
    fetch('https://localhost5000')
      .then((response) => response.json())
      .then((data) => this.setState({ data }))
  }
}

export default Profile
